import React from 'react';
import Document, { Html, Head, Main, NextScript } from 'next/document';

class MyDocument extends Document {
    static async getInitialProps(ctx) {
        const initialProps = await Document.getInitialProps(ctx);

        return { ...initialProps };
    }

    render() {
        return (
            <Html>
                <Head>
                    <link rel="stylesheet"
                          href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
                          integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
                          crossOrigin="anonymous"/>
                    <link rel="stylesheet" href="https://cdn.linearicons.com/free/1.0.0/icon-font.min.css"/>
                    <link rel="stylesheet" href="../static/styles/css/main.css"/>
                    <link href='https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.5.0/css/font-awesome.min.css'
                          rel='stylesheet' type='text/css'/>
                    <link rel="stylesheet" href="../static/styles/vendor/reactstrap.css"/>
                    <link rel="stylesheet" href="../static/styles/vendor/toast.css"/>
                    <link rel="stylesheet" href="../static/styles/vendor/rangeSlider.css"/>
                    <link rel="stylesheet" type="text/css" charset="UTF-8"
                          href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css"/>
                    <link rel="stylesheet" type="text/css"
                          href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css"/>
                    <script src="https://cdn.linearicons.com/free/1.0.0/svgembedder.min.js"></script>
                </Head>

                <body>
                <Main/>
                <NextScript/>
                </body>
                <script src="https://kit.fontawesome.com/bf472f0730.js"></script>
            </Html>
        );
    }
}

export default MyDocument;
